import React from 'react'
import Slider from 'react-slick'
import "slick-carousel/slick/slick.css";
import "slick-carousel/slick/slick-theme.css";

const SlideShow2=()=>{
  var settings={
    dots:true,
    infinite:true
  }
}
const Learn = () => {
  return (
    <div className="slide-container">
      <Slider {...settings}>
        <div>
          <h1>hello</h1>
        </div>
      </Slider>
    </div>
  )
}

export default Learn
